parcel.on('playerenter', (e)=> {
	if(!milsecInterval){ 
		currentTotalMilsec = 0;
		milsecPassed = 0; 
		secPassed = 0; 
		milsecInterval= setInterval(updateTime, 1) 
	}

	var milsecInterval;
	var secPassed = 80;
	var milsecPassed = 0;
	var currentTotalMilsec = 0;
	var timeResult = 0;
	var firePos = 0;
	var targetClicked;	
	var targetPos1;
	var targetPos2;
	var targetPos3;
	var targetPos4;
	var targetPos5;
	var orgTargetPos1;
	var orgTargetPos2;	
	var orgTargetPos3;	
	var orgTargetPos4;	
	var orgTargetPos5;		

	var xDiff = 0;
	var xInc = 0;
	var yDiff = 0;
	var yInc = 0;
	var zDiff = 0;
	var zInc = 0;
	var xI = 0;
	var yI = 0;
	var zI = 0;	
	var xI2 = 0;
	var yI2 = 0;
	var zI2 = 0;
	var xI3 = 0;
	var yI3 = 0;
	var zI3 = 0;
	var xI4 = 0;
	var yI4 = 0;
	var zI4 = 0;
	var xI5 = 0;
	var yI5 = 0;
	var zI5 = 0;

	orgTargetPos1 = target1.position;
	orgTargetPos2 = target2.position;
	orgTargetPos3 = target3.position;
	orgTargetPos4 = target4.position;
	orgTargetPos5 = target5.position;

	e.player.on('move', (eee)=> {
		xI = (target1.position.x - eee.position[0]) / 100;
		yI = (target1.position.y - eee.position[1]) / 100;
		zI = (target1.position.z - eee.position[2]) / 100;

		xI2 = (target2.position.x - eee.position[0]) / 100;
		yI2 = (target2.position.y - eee.position[1]) / 100;
		zI2 = (target2.position.z - eee.position[2]) / 100;

		xI3 = (target3.position.x - eee.position[0]) / 100;
		yI3 = (target3.position.y - eee.position[1]) / 100;
		zI3 = (target3.position.z - eee.position[2]) / 100;

		xI4 = (target4.position.x - eee.position[0]) / 100;
		yI4 = (target4.position.y - eee.position[1]) / 100;
		zI4 = (target4.position.z - eee.position[2]) / 100;

		xI5 = (target5.position.x - eee.position[0]) / 100;
		yI5 = (target5.position.y - eee.position[1]) / 100;
		zI5 = (target5.position.z - eee.position[2]) / 100;
	})

	feature.on('click', (ee) => {  
		doorSound.play();

	  if(gameActive._content.text == "false") {
		  resetGame();   

		  let doorAnimation = door.createAnimation('position');
		doorAnimation.setKeys([{
		  frame: 30, // standard is 30 fps (means it take 1 second)
		  value: door.position.add( new Vector3(0,0,-1.9) )
		}])
		door.startAnimations( [doorAnimation] );    
		gameActive.set({ text: "true"});
	  } else {
		currentTotalMilsec = 0;
		milsecPassed = 0; 
		secPassed = 80;
		timeDisplay.set( { text: '80' } );  
		time.set( { text: '80' } );
		score.set( { text: '0' } );

		doorAnimation.setKeys([{
		  frame: 30, // standard is 30 fps (means it take 1 second)
		  value: door.position.add( new Vector3(0,0,0) )
		}])
		door.startAnimations( [doorAnimation] );

		gameActive.set({ text: "false"});      
	  }

	})

	target1.on('click', (ee)=> { 
		if(ballFired._content.text == "false"){ 
			targetClicked = parcel.getFeatureById('target1'); 
			fireBall(ee, ball);
		} 
	});
	target2.on('click', (ee)=> { 
		if(ballFired._content.text == "false"){ 
			targetClicked = parcel.getFeatureById('target2'); 
			fireBall(ee, ball);
		} 
	});
	target3.on('click', (ee)=> { 
		if(ballFired._content.text == "false"){ 
			targetClicked = parcel.getFeatureById('target3'); 
			fireBall(ee, ball);
		} 
	});
	target4.on('click', (ee)=> { 
		if(ballFired._content.text == "false"){ 
			targetClicked = parcel.getFeatureById('target4'); 
			fireBall(ee, ball);
		} 
	});
	target5.on('click', (ee)=> { 
		if(ballFired._content.text == "false"){ 
			targetClicked = parcel.getFeatureById('target5'); 
			fireBall(ee, ball);
		} 
	});

	target1.on('trigger', (ee)=> { isDead.set({ text: "true"});});
	target2.on('trigger', (ee)=> { isDead.set({ text: "true"});});
	target3.on('trigger', (ee)=> { isDead.set({ text: "true"});});
	target4.on('trigger', (ee)=> { isDead.set({ text: "true"});});
	target5.on('trigger', (ee)=> { isDead.set({ text: "true"});});

	caveOpening.on('trigger', (ee)=> { enterMainArea.set({ text: "true"});});

function fireBall(ee, ball){
		ballFired.set({ text: "true"});		
		firePos = ball.position;
		targetPos1 = targetClicked.position;

		ball.set({rotation:[ee.player.rotation.x, ee.player.rotation.y, ee.player.rotation.z]});
		ball.position.set(ee.player.position.x, (ee.player.position.y - 0.25), ee.player.position.z);

		xDiff = targetPos1.x - ball.position.x;
		xInc = xDiff/9
		yDiff = targetPos1.y - ball.position.y;
		yInc = yDiff/7;
		zDiff = targetPos1.z - ball.position.z;
		zInc = zDiff/9;	
	}

function resetGame(){
		ball.scale.set(0.5, 0.5, 0.5);
		ball.position.set(0, -1, 0);

		item1.position.set(-1, 1.2, 1);
		item2.position.set(3, 1.2, 1.25);
		item4.position.set(8, 1.2, -4.25);
		item10.position.set(2.5, 1.2, -2.25);
		item11.position.set(5, 1.2, -8.25);
		item13.position.set(0.75, 1.2, -8.25);
		item14.position.set(-1, 1.2, -2.25);
		item15.position.set(-0.75, 1.2, -4.5);
		item16.position.set(9, 1.2, -6.55);
		item17.position.set(-7.7, 1.2, -6.65);

		target1.set({rotation:[0,-1.57,0]});
		target1.position.set(4.75, 3, 0.75);
		target1.scale.set(1.3, 1.3, 1.3);

		target2.set({rotation:[0,-1.57,0]});
		target2.position.set(9.6, 2.55, -3.3);
		target2.scale.set(1.3, 1.3, 1.3);

		target3.set({rotation:[0,-0.78,0]});
		target3.position.set(9.75, 2.75, -8.75);
		target3.scale.set(1.3, 1.3, 1.3);

		target4.set({rotation:[0,1.57,0]});
		target4.position.set(1.57, 2.65, -2.02);
		target4.scale.set(1.3, 1.3, 1.3);

		target5.set({rotation:[0,0.78,0]});
		target5.position.set(2, 2.75, -8.75);
		target5.scale.set(1.3, 1.3, 1.3);

		isDead1.set({ text: "false"});
		isDead2.set({ text: "false"});
		isDead3.set({ text: "false"});
		isDead4.set({ text: "false"});
		isDead5.set({ text: "false"});

		milsecInterval;
		secPassed = 80;
		milsecPassed = 0;
		currentTotalMilsec = 0;
		timeDisplay.set( { text: '80' } );  
		time.set( { text: '80' } ); 
		score.set( { text: '0' } );	
		firePos = 0;	
		targetPos1;		
		enterMainArea.set({ text: "false"});

		doorAnimation.setKeys([{
		  frame: 30, // standard is 30 fps (means it take 1 second)
		  value: door.position.add( new Vector3(0,0,0) )
		}])
		door.startAnimations( [doorAnimation] );

		gameActive.set({ text: "false"});
}

function updateTime(){  
  if(gameActive._content.text == "true" && parseInt(score._content.text) < 15){
    currentTotalMilsec ++;

	if((milsecPassed == 2 || milsecPassed == 4 || milsecPassed == 6 || milsecPassed == 8 || 
			milsecPassed == 10 || milsecPassed == 12 || milsecPassed == 14 || milsecPassed == 16 || milsecPassed == 18 ||
			milsecPassed == 20 || milsecPassed == 22 || milsecPassed == 24 || milsecPassed == 26 || milsecPassed == 28) ){

			if(isDead._content.text == "false"){
				if(gameActive._content.text == "true"){
					if(isDead1._content.text == "false"){
						target1.set({rotation:[e.player.rotation.x,e.player.rotation.y + 3.14,e.player.rotation.z]});
						target1.position.set(orgTargetPos1.x - xI, orgTargetPos1.y - yI, orgTargetPos1.z - zI);
					}

					if(enterMainArea._content.text == "true"){
						if(isDead2._content.text == "false"){
							target2.set({rotation:[e.player.rotation.x,e.player.rotation.y + 3.14,e.player.rotation.z]});
							target2.position.set(orgTargetPos2.x - xI2, orgTargetPos2.y - yI2, orgTargetPos2.z - zI2);
						}
						if(isDead3._content.text == "false"){
							target3.set({rotation:[e.player.rotation.x,e.player.rotation.y + 3.14,e.player.rotation.z]});
							target3.position.set(orgTargetPos3.x - xI3, orgTargetPos3.y - yI3, orgTargetPos3.z - zI3);
						}
						if(isDead4._content.text == "false"){
							target4.set({rotation:[e.player.rotation.x,e.player.rotation.y + 3.14,e.player.rotation.z]});
							target4.position.set(orgTargetPos4.x - xI4, orgTargetPos4.y - yI4, orgTargetPos4.z - zI4);
						}
						if(isDead5._content.text == "false"){
							target5.set({rotation:[e.player.rotation.x,e.player.rotation.y + 3.14,e.player.rotation.z]});
							target5.position.set(orgTargetPos5.x - xI5, orgTargetPos5.y - yI5, orgTargetPos5.z - zI5);
						}						
					}
				}

				if(ballFired._content.text == "true"){    
					ball.scale.set(0.3, 0.3, 0.3);
					ball.position.set(firePos.x + xInc, firePos.y + yInc, firePos.z + zInc);

					if( (ball.position.x <= targetClicked.position.x + 0.75) && (ball.position.x >= targetClicked.position.x - 0.75) &&
						(ball.position.z <= targetClicked.position.z + 0.75) && (ball.position.z >= targetClicked.position.z - 0.75) &&
						(ball.position.y <= targetClicked.position.y + 0.75) && (ball.position.y >= targetClicked.position.y - 0.75) 
					){
						console.log("BOOM!");	
						explosionSound.play();

						ball.scale.set(0, 0, 0);						  
						ballFired.set({ text: "false"});
						var currentScore = parseInt(score._content.text);

						if(targetClicked._content.id == "target1"){
							currentScore = currentScore + 1;
							targetClicked.scale.set(0, 0, 0);
							isDead1.set({ text: "true"});
							target1.position.set(0, -1, 0);
						}
						if(targetClicked._content.id == "target2"){
							currentScore = currentScore + 1;
							targetClicked.scale.set(0, 0, 0);
							isDead2.set({ text: "true"});
							target2.position.set(0, -1, 0);
						}
						if(targetClicked._content.id == "target3"){
							currentScore = currentScore + 1;
							targetClicked.scale.set(0, 0, 0);
							isDead3.set({ text: "true"});
							target3.position.set(0, -1, 0);
						}
						if(targetClicked._content.id == "target4"){
							currentScore = currentScore + 1;
							targetClicked.scale.set(0, 0, 0);
							isDead4.set({ text: "true"});
							target4.position.set(0, -1, 0);
						}
						if(targetClicked._content.id == "target5"){
							currentScore = currentScore + 1;
							targetClicked.scale.set(0, 0, 0);
							isDead5.set({ text: "true"});
							target5.position.set(0, -1, 0);
						}

						score.set({ text: currentScore.toString()});

					} else {
						if(milsecPassed > 28){ball.scale.set(0, 0, 0);}
					}
				}
			} else {		
				e.player.teleportTo("N@5576W,1858N,-3.5U");
				gameActive.set({ text: "false"});				
				resetGame();
				isDead.set({ text: "false"});
			}
	}

    if(milsecPassed > 30 && secPassed > 0) {     
        milsecPassed = 0;  
        secPassed --;

        if(secPassed == 0) {
            secPassed --;

            timeDisplay.set( { text: '0' } );
			time.set( { text: '0' } );
			isDead.set({ text: "true"}); 		
        } else{
            if(secPassed > 0){
                timeDisplay.set( { text: secPassed.toString() } ); 
				time.set( { text: secPassed.toString() } );
            }  
        } 
    } else {
        milsecPassed ++;
    } 
	}
  }
  });

